import {useParams} from "react-router-dom";
function MovieDetail({data}) {
  const {id} = useParams();
  return (
    <div>
      {console.log("Data Movie Detail:", data)}
      {data
        .filter((film) => film.id === id)
        .map((film, index) => (
          <div>{console.log(film)}</div>
        ))}
    </div>
  );
}

export default MovieDetail;
